INSERT INTO quiz_question VALUES(1,1,NULL,'','All groups are necessarily commutative','This is of course not true. Group is commutative if for all the members of the group ab=ba holds, but this is not so always.');
INSERT INTO quiz_question VALUES(2,1,NULL,'','Simple groups do not have subgroups?','Simple groups are grops that do not have any nontrivial normal subgroups. This does not mean that they are not allowed to have subgroups that are not normal.');
INSERT INTO quiz_question VALUES(3,1,NULL,'','The order of the group G, denoted |G| is:','Order of the group is simply the number of elements in the group.');
INSERT INTO quiz_question VALUES(4,1,NULL,'','What is the order of the group of symmetry of square, 4mm?','The order is number of 8, that is 4 rotations + 4 mirror lines.');
INSERT INTO quiz_question VALUES(5,1,NULL,'','What is the generator of the group?','The generators of the group are elements that can be combined by themselves and all other elements of the group can thus be generated.');
INSERT INTO quiz_question VALUES(6,1,NULL,'','Group 2 (180 rotations) is a subgroup of group 4 (90 degree rotations) around the same axis?','The group {e,2} is the subgroup of {e, 2, 4+, 4-}.');
INSERT INTO quiz_question VALUES(7,1,NULL,'','Lagrange''s theorem states that order of the subgroup may be any number lower than the order of the group?','No this is false. Lagrenge''s theorem states that the order of any subgroup can only be a number which devides the order of the group. So for example the order of any subgroup of a group of say 12 members may be 2,3,4,6.');
